import React from 'react';
import classes from'./Recipe.css'

const recipe = (props) => {
    return (
        <div className={classes.Recipe}>
            <p onClick={props.click} >{props.name} and I am {props.age} years old!</p>
            <p>{props.children}</p>
        </div>
    )
};

export default recipe;
